// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../interfaces/IERC4907.sol";

/**
 * @title MockERC4907
 * @dev Mock implementation of ERC-4907 for testing purposes
 */
contract MockERC4907 is ERC721, IERC4907 {
    // Mapping from token ID to user info
    mapping(uint256 => UserInfo) private _users;

    struct UserInfo {
        address user;   // address of user role
        uint64 expires; // unix timestamp, user expires
    }

    constructor() ERC721("MockERC4907", "MOCK4907") {}

    function mint(address to, uint256 tokenId) external {
        _mint(to, tokenId);
    }

    function setUser(uint256 tokenId, address user, uint64 expires) public virtual override {
        require(_isApprovedOrOwner(msg.sender, tokenId), "ERC4907: transfer caller is not owner nor approved");
        UserInfo storage info = _users[tokenId];
        info.user = user;
        info.expires = expires;
        emit UpdateUser(tokenId, user, expires);
    }

    function userOf(uint256 tokenId) public view virtual override returns (address) {
        if (uint256(_users[tokenId].expires) >= block.timestamp) {
            return _users[tokenId].user;
        } else {
            return address(0);
        }
    }

    function userExpires(uint256 tokenId) public view virtual override returns (uint256) {
        return _users[tokenId].expires;
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721, IERC165) returns (bool) {
        return interfaceId == type(IERC4907).interfaceId || super.supportsInterface(interfaceId);
    }
}

contracts/NFTFlowCore.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interfaces/IERC4907.sol";
import "./interfaces/IPriceOracle.sol";
import "./PaymentStream.sol";
import "./ReputationSystem.sol";

contract NFTFlowCore is ReentrancyGuard, Ownable {
    // Somnia MulticallV3 address
    address constant MULTICALL = 0x841b8199E6d3Db3C6f264f6C2bd8848b3cA64223;

    struct Rental {
        address lender;
        address tenant;
        address nftContract;
        uint256 tokenId;
        uint256 startTime;
        uint256 endTime;
        uint256 totalPrice;
        uint256 paymentStreamId;
        bool active;
    }

    struct NFTListing {
        address nftContract;
        uint256 tokenId;
        address owner;
        uint256 pricePerSecond;
        uint256 minDuration;
        uint256 maxDuration;
        uint256 collateralRequired;
        bool active;
    }

    mapping(bytes32 => Rental) public rentals;
    mapping(bytes32 => NFTListing) public listings;
    mapping(address => uint256) public userReputation;

    PaymentStream public paymentStreamFactory;
    ReputationSystem public reputationSystem;
    IPriceOracle public priceOracle;

    uint256 public constant MIN_RENTAL_DURATION = 60; // 1 minute minimum
    uint256 public constant MAX_RENTAL_DURATION = 2592000; // 30 days maximum

    event NFTListedForRent(
        bytes32 indexed listingId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address owner,
        uint256 pricePerSecond,
        uint256 minDuration,
        uint256 maxDuration
    );

    event NFTRented(
        bytes32 indexed rentalId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address tenant,
        uint256 duration,
        uint256 totalPrice
    );

    event RentalCompleted(bytes32 indexed rentalId);
    event RentalCancelled(bytes32 indexed rentalId, uint256 refundAmount);

    constructor(
        address _paymentStreamFactory,
        address _reputationSystem,
        address _priceOracle
    ) Ownable() {
        paymentStreamFactory = PaymentStream(payable(_paymentStreamFactory));
        reputationSystem = ReputationSystem(_reputationSystem);
        priceOracle = IPriceOracle(_priceOracle);
    }

    function listNFTForRent(
        address nftContract,
        uint256 tokenId,
        uint256 pricePerSecond,
        uint256 minDuration,
        uint256 maxDuration,
        uint256 collateralRequired
    ) external {
        require(IERC721(nftContract).ownerOf(tokenId) == msg.sender, "Not NFT owner");
        require(pricePerSecond > 0, "Price must be greater than 0");
        require(minDuration >= MIN_RENTAL_DURATION, "Min duration too short");
        require(maxDuration <= MAX_RENTAL_DURATION, "Max duration too long");
        require(minDuration <= maxDuration, "Invalid duration range");

        // Approve this contract to manage the NFT
        IERC721(nftContract).approve(address(this), tokenId);

        bytes32 listingId = keccak256(abi.encodePacked(nftContract, tokenId, block.timestamp));

        listings[listingId] = NFTListing({
            nftContract: nftContract,
            tokenId: tokenId,
            owner: msg.sender,
            pricePerSecond: pricePerSecond,
            minDuration: minDuration,
            maxDuration: maxDuration,
            collateralRequired: collateralRequired,
            active: true
        });

        emit NFTListedForRent(listingId, nftContract, tokenId, msg.sender, pricePerSecond, minDuration, maxDuration);
    }

    function rentNFT(
        bytes32 listingId,
        uint256 duration
    ) external payable nonReentrant {
        NFTListing storage listing = listings[listingId];
        require(listing.active, "Listing not active");
        require(duration >= listing.minDuration, "Duration too short");
        require(duration <= listing.maxDuration, "Duration too long");
        require(listing.owner != msg.sender, "Cannot rent own NFT");

        // Check if NFT is available (not currently rented)
        bytes32 rentalId = keccak256(abi.encodePacked(listing.nftContract, listing.tokenId));
        require(!rentals[rentalId].active, "NFT already rented");

        uint256 totalPrice = listing.pricePerSecond * duration;
        require(msg.value >= totalPrice, "Insufficient payment");

        // Check reputation and collateral requirements
        uint256 userRep = reputationSystem.getReputationScore(msg.sender);
        uint256 requiredCollateral = listing.collateralRequired;

        if (userRep < 100) { // Low reputation users need collateral
            require(msg.value >= totalPrice + requiredCollateral, "Insufficient collateral");
        }

        // Create payment stream
        uint256 streamId = paymentStreamFactory.createStream{value: msg.value}(
            listing.owner,
            block.timestamp,
            block.timestamp + duration,
            listing.nftContract
        );

        // Set user for ERC-4907 if the NFT supports it
        try IERC4907(listing.nftContract).setUser(listing.tokenId, msg.sender, uint64(block.timestamp + duration)) {
            // ERC-4907 supported
        } catch {
            // Fallback: transfer NFT temporarily (requires approval)
            IERC721(listing.nftContract).transferFrom(listing.owner, address(this), listing.tokenId);
        }

        rentals[rentalId] = Rental({
            lender: listing.owner,
            tenant: msg.sender,
            nftContract: listing.nftContract,
            tokenId: listing.tokenId,
            startTime: block.timestamp,
            endTime: block.timestamp + duration,
            totalPrice: totalPrice,
            paymentStreamId: streamId,
            active: true
        });

        emit NFTRented(rentalId, listing.nftContract, listing.tokenId, msg.sender, duration, totalPrice);
    }

    function completeRental(bytes32 rentalId) external {
        Rental storage rental = rentals[rentalId];
        require(rental.active, "Rental not active");
        require(block.timestamp >= rental.endTime, "Rental period not ended");
        require(msg.sender == rental.tenant || msg.sender == rental.lender, "Not authorized");

        // Clear user in ERC-4907
        try IERC4907(rental.nftContract).setUser(rental.tokenId, address(0), 0) {
            // ERC-4907 supported
        } catch {
            // Fallback: return NFT to owner
            // This would need the NFT contract address, which we'd need to store
        }

        // Update reputation
        reputationSystem.updateReputation(rental.tenant, true);

        rental.active = false;
        emit RentalCompleted(rentalId);
    }

    function cancelRental(bytes32 rentalId) external {
        Rental storage rental = rentals[rentalId];
        require(rental.active, "Rental not active");
        require(msg.sender == rental.tenant || msg.sender == rental.lender, "Not authorized");

        // Cancel payment stream
        paymentStreamFactory.cancelStream(rental.paymentStreamId);

        // Clear user in ERC-4907
        try IERC4907(rental.nftContract).setUser(rental.tokenId, address(0), 0) {
            // ERC-4907 supported
        } catch {
            // Fallback: return NFT to owner
        }

        rental.active = false;
        emit RentalCancelled(rentalId, 0); // Refund amount would be calculated by PaymentStream
    }

    function getAvailableNFTs() external view returns (NFTListing[] memory) {
        // This would need to be implemented with proper filtering
        // For now, return empty array
        NFTListing[] memory availableNFTs = new NFTListing[](0);
        return availableNFTs;
    }

    function getUserRentals(address user) external view returns (bytes32[] memory) {
        // This would need to track user rentals
        // For now, return empty array
        bytes32[] memory userRentals = new bytes32[](0);
        return userRentals;
    }

    function updatePriceOracle(address newOracle) external onlyOwner {
        require(newOracle != address(0), "Invalid oracle address");
        priceOracle = IPriceOracle(newOracle);
    }

    function emergencyWithdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
}

contracts/NFTFlowSomniaOptimized.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interfaces/IERC4907.sol";
import "./interfaces/IPriceOracle.sol";
import "./PaymentStream.sol";
import "./ReputationSystem.sol";

/**
 * @title NFTFlowSomniaOptimized
 * @dev Enhanced NFT rental contract optimized for Somnia's high throughput and low fees
 * Leverages Somnia's 1M+ TPS, sub-second finality, and sub-cent transaction costs
 */
contract NFTFlowSomniaOptimized is ReentrancyGuard, Ownable {
    // Somnia MulticallV3 address for batch operations
    address constant MULTICALL_V3 = 0x841b8199E6d3Db3C6f264f6C2bd8848b3cA64223;

    // Somnia-specific storage optimization using packed structs
    struct Rental {
        address lender;           // 20 bytes
        address tenant;           // 20 bytes
        address nftContract;      // 20 bytes
        uint256 tokenId;          // 32 bytes
        uint40 startTime;         // 5 bytes - Reduced size for gas optimization
        uint40 endTime;           // 5 bytes - Reduced size for gas optimization
        uint96 totalPrice;        // 12 bytes - Optimized for Somnia's low fee environment
        uint256 paymentStreamId;  // 32 bytes - Stream ID instead of address
        bool isActive;           // 1 byte
        uint8 rentalType;        // 1 byte - Gaming, Art, Metaverse, etc.
    }

    struct NFTListing {
        address nftContract;     // 20 bytes
        uint256 tokenId;         // 32 bytes
        address owner;           // 20 bytes
        uint96 pricePerSecond;   // 12 bytes - Optimized for micro-payments
        uint32 minDuration;      // 4 bytes
        uint32 maxDuration;      // 4 bytes
        uint96 collateralRequired; // 12 bytes
        bool isActive;           // 1 byte
        uint8 utilityType;       // 1 byte - Gaming, Art, Metaverse, etc.
    }

    // Leverage Somnia's high TPS for frequent state updates
    mapping(bytes32 => Rental) public rentals;
    mapping(bytes32 => NFTListing) public listings;
    mapping(address => uint256) public reputationScore;
    mapping(address => uint256) public userRentalCount;

    // Somnia-optimized constants
    uint256 public constant MIN_RENTAL_DURATION = 60; // 1 minute minimum
    uint256 public constant MAX_RENTAL_DURATION = 2592000; // 30 days maximum
    uint256 public constant MAX_PRICE_PER_SECOND = 0.01 ether; // Prevent excessive pricing
    uint256 public constant MIN_PRICE_PER_SECOND = 0.000001 ether; // Minimum viable price

    PaymentStream public paymentStreamFactory;
    ReputationSystem public reputationSystem;
    IPriceOracle public priceOracle;

    // Events optimized for Somnia's high throughput
    event NFTListedForRent(
        bytes32 indexed listingId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address owner,
        uint256 pricePerSecond,
        uint256 minDuration,
        uint256 maxDuration,
        uint8 utilityType
    );

    event NFTRented(
        bytes32 indexed rentalId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address lender,
        address tenant,
        uint256 startTime,
        uint256 endTime,
        uint256 pricePerSecond,
        uint256 totalPrice
    );

    event RentalCompleted(bytes32 indexed rentalId, uint256 finalAmount);
    event RentalCancelled(bytes32 indexed rentalId, uint256 refundAmount);
    event PaymentStreamUpdated(bytes32 indexed rentalId, uint256 releasedAmount);

    constructor(
        address _paymentStreamFactory,
        address _reputationSystem,
        address _priceOracle
    ) Ownable() {
        paymentStreamFactory = PaymentStream(payable(_paymentStreamFactory));
        reputationSystem = ReputationSystem(_reputationSystem);
        priceOracle = IPriceOracle(_priceOracle);
    }

    /**
     * @dev List NFT for rent with Somnia-optimized parameters
     */
    function listNFTForRent(
        address nftContract,
        uint256 tokenId,
        uint256 pricePerSecond,
        uint256 minDuration,
        uint256 maxDuration,
        uint256 collateralRequired,
        uint8 utilityType
    ) external {
        require(IERC721(nftContract).ownerOf(tokenId) == msg.sender, "Not NFT owner");
        require(pricePerSecond >= MIN_PRICE_PER_SECOND && pricePerSecond <= MAX_PRICE_PER_SECOND, "Invalid price");
        require(minDuration >= MIN_RENTAL_DURATION, "Min duration too short");
        require(maxDuration <= MAX_RENTAL_DURATION, "Max duration too long");
        require(minDuration <= maxDuration, "Invalid duration range");
        require(utilityType > 0 && utilityType <= 10, "Invalid utility type");

        // Approve this contract to manage the NFT
        IERC721(nftContract).approve(address(this), tokenId);

        bytes32 listingId = keccak256(abi.encodePacked(nftContract, tokenId, block.timestamp, msg.sender));

        listings[listingId] = NFTListing({
            nftContract: nftContract,
            tokenId: tokenId,
            owner: msg.sender,
            pricePerSecond: uint96(pricePerSecond),
            minDuration: uint32(minDuration),
            maxDuration: uint32(maxDuration),
            collateralRequired: uint96(collateralRequired),
            isActive: true,
            utilityType: utilityType
        });

        emit NFTListedForRent(listingId, nftContract, tokenId, msg.sender, pricePerSecond, minDuration, maxDuration, utilityType);
    }

    /**
     * @dev Rent NFT with Somnia-optimized batch operations
     */
    function rentNFT(
        bytes32 listingId,
        uint256 duration
    ) external payable nonReentrant {
        NFTListing storage listing = listings[listingId];
        require(listing.isActive, "Listing not active");
        require(duration >= listing.minDuration, "Duration too short");
        require(duration <= listing.maxDuration, "Duration too long");
        require(listing.owner != msg.sender, "Cannot rent own NFT");

        // Check if NFT is available (not currently rented)
        bytes32 rentalId = keccak256(abi.encodePacked(listing.nftContract, listing.tokenId));
        require(!rentals[rentalId].isActive, "NFT already rented");

        uint256 totalPrice = uint256(listing.pricePerSecond) * duration;
        require(msg.value >= totalPrice, "Insufficient payment");

        // Check reputation and collateral requirements
        uint256 userRep = reputationSystem.getReputationScore(msg.sender);
        uint256 requiredCollateral = uint256(listing.collateralRequired);

        if (userRep < 100) { // Low reputation users need collateral
            require(msg.value >= totalPrice + requiredCollateral, "Insufficient collateral");
        }

        // Utilize Somnia's MultiCall for batch operations
        bytes[] memory calls = new bytes[](2);
        calls[0] = abi.encodeWithSignature(
            "approve(address,uint256)",
            address(this),
            listing.tokenId
        );
        calls[1] = abi.encodeWithSignature(
            "setUser(uint256,address,uint64)",
            listing.tokenId,
            msg.sender,
            uint64(block.timestamp + duration)
        );

        // Execute batch call leveraging Somnia's high TPS
        (bool success, ) = MULTICALL_V3.delegatecall(
            abi.encodeWithSignature("aggregate((address,bytes)[])", calls)
        );
        require(success, "Multicall failed");

        // Create payment stream optimized for Somnia's low fees
        uint256 streamId = paymentStreamFactory.createStream{value: msg.value}(
            listing.owner,
            block.timestamp,
            block.timestamp + duration,
            listing.nftContract
        );

        rentals[rentalId] = Rental({
            lender: listing.owner,
            tenant: msg.sender,
            nftContract: listing.nftContract,
            tokenId: listing.tokenId,
            startTime: uint40(block.timestamp),
            endTime: uint40(block.timestamp + duration),
            totalPrice: uint96(totalPrice),
            paymentStreamId: streamId,
            isActive: true,
            rentalType: listing.utilityType
        });

        userRentalCount[msg.sender]++;

        emit NFTRented(
            rentalId,
            listing.nftContract,
            listing.tokenId,
            listing.owner,
            msg.sender,
            block.timestamp,
            block.timestamp + duration,
            uint256(listing.pricePerSecond),
            totalPrice
        );
    }

    /**
     * @dev Complete rental leveraging Somnia's sub-second finality
     */
    function completeRental(bytes32 rentalId) external {
        Rental storage rental = rentals[rentalId];
        require(rental.isActive, "Rental not active");
        require(block.timestamp >= rental.endTime, "Rental period not ended");
        require(msg.sender == rental.tenant || msg.sender == rental.lender, "Not authorized");

        // Clear user in ERC-4907
        try IERC4907(rental.nftContract).setUser(rental.tokenId, address(0), 0) {
            // ERC-4907 supported
        } catch {
            // Fallback: return NFT to owner
        }

        // Update reputation leveraging Somnia's high TPS
        reputationSystem.updateReputation(rental.tenant, true);

        rental.isActive = false;
        emit RentalCompleted(rentalId, rental.totalPrice);
    }

    /**
     * @dev Cancel rental with instant refund leveraging Somnia's low fees
     */
    function cancelRental(bytes32 rentalId) external {
        Rental storage rental = rentals[rentalId];
        require(rental.isActive, "Rental not active");
        require(msg.sender == rental.tenant || msg.sender == rental.lender, "Not authorized");

        // Cancel payment stream
        paymentStreamFactory.cancelStream(rental.paymentStreamId);

        // Clear user in ERC-4907
        try IERC4907(rental.nftContract).setUser(rental.tokenId, address(0), 0) {
            // ERC-4907 supported
        } catch {
            // Fallback: return NFT to owner
        }

        rental.isActive = false;
        emit RentalCancelled(rentalId, rental.totalPrice);
    }

    /**
     * @dev Get available NFTs leveraging Somnia's high throughput for real-time data
     */
    function getAvailableNFTs() external view returns (NFTListing[] memory) {
        // This would need to be implemented with proper filtering
        // For now, return empty array
        NFTListing[] memory availableNFTs = new NFTListing[](0);
        return availableNFTs;
    }

    /**
     * @dev Get user rentals leveraging Somnia's fast read operations
     */
    function getUserRentals(address user) external view returns (bytes32[] memory) {
        // This would need to track user rentals
        // For now, return empty array
        bytes32[] memory userRentals = new bytes32[](0);
        return userRentals;
    }

    /**
     * @dev Update price oracle leveraging Somnia's governance capabilities
     */
    function updatePriceOracle(address newOracle) external onlyOwner {
        require(newOracle != address(0), "Invalid oracle address");
        priceOracle = IPriceOracle(newOracle);
    }

    /**
     * @dev Emergency withdraw leveraging Somnia's low fees for admin operations
     */
    function emergencyWithdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    /**
     * @dev Get rental statistics leveraging Somnia's high throughput
     */
    function getRentalStats() external view returns (
        uint256 totalRentals,
        uint256 activeRentals,
        uint256 totalVolume,
        uint256 averageRentalDuration
    ) {
        // This would calculate real-time statistics
        return (0, 0, 0, 0);
    }
}

contracts/PaymentStream.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

/**
 * @title PaymentStream
 * @dev Enhanced contract for real-time payment streaming for NFT rentals
 * Implements continuous payment flow with platform fees and creator royalties
 * Designed for formal verification and security
 */
contract PaymentStream is ReentrancyGuard, Ownable, Pausable {

    struct Stream {
        address sender;
        address recipient;
        uint256 deposit;
        uint256 ratePerSecond;
        uint256 startTime;
        uint256 stopTime;
        uint256 remainingBalance;
        uint256 totalWithdrawn;
        bool active;
        bool finalized;
        uint256 platformFeeAmount;
        uint256 creatorRoyaltyAmount;
        address creatorAddress;
    }

    // State variables
    mapping(uint256 => Stream) public streams;
    mapping(address => uint256[]) public senderStreams;
    mapping(address => uint256[]) public recipientStreams;

    uint256 public nextStreamId;
    uint256 public constant MINIMUM_STREAM_DURATION = 1; // 1 second
    uint256 public constant BASIS_POINTS = 10000;

    // Fee structure
    uint256 public platformFeePercentage = 250; // 2.5%
    uint256 public creatorRoyaltyPercentage = 50; // 0.5% of total rental
    address public treasury;
    mapping(address => address) public collectionCreators; // NFT contract => creator address

    // Security features
    mapping(address => bool) public authorizedContracts;
    uint256 public maxStreamDuration = 30 days;

    // Events
    event StreamCreated(
        uint256 indexed streamId,
        address indexed sender,
        address indexed recipient,
        uint256 deposit,
        uint256 ratePerSecond,
        uint256 startTime,
        uint256 stopTime,
        uint256 platformFeeAmount,
        uint256 creatorRoyaltyAmount
    );

    event StreamWithdrawn(
        uint256 indexed streamId,
        address indexed recipient,
        uint256 amount,
        uint256 totalWithdrawn
    );

    event StreamCancelled(
        uint256 indexed streamId,
        address indexed sender,
        address indexed recipient,
        uint256 senderBalance,
        uint256 recipientBalance
    );

    event StreamFinalized(
        uint256 indexed streamId,
        uint256 totalPaid,
        uint256 platformFeeCollected,
        uint256 creatorRoyaltyCollected
    );

    event PlatformFeeWithdrawn(
        address indexed treasury,
        uint256 amount
    );

    event CreatorRoyaltyPaid(
        address indexed creator,
        uint256 amount
    );

    // Modifiers
    modifier onlyAuthorized() {
        require(
            authorizedContracts[msg.sender] || 
            msg.sender == owner(),
            "Not authorized"
        );
        _;
    }

    constructor(address _treasury) Ownable() {
        treasury = _treasury != address(0) ? _treasury : msg.sender;
    }

    /**
     * @dev Create a new payment stream with fee calculation
     * @param recipient Address to receive the stream
     * @param startTime When the stream starts (unix timestamp)
     * @param stopTime When the stream stops (unix timestamp)
     * @param nftContract NFT contract address for creator royalty calculation
     */
    function createStream(
        address recipient,
        uint256 startTime,
        uint256 stopTime,
        address nftContract
    ) external payable nonReentrant whenNotPaused returns (uint256 streamId) {
        require(recipient != address(0), "Invalid recipient");
        require(recipient != msg.sender, "Cannot stream to self");
        require(msg.value > 0, "Deposit must be greater than 0");
        require(startTime >= block.timestamp, "Start time in the past");
        require(stopTime > startTime, "Stop time before start time");

        uint256 duration = stopTime - startTime;
        require(duration >= MINIMUM_STREAM_DURATION, "Duration too short");
        require(duration <= maxStreamDuration, "Duration too long");

        // Calculate fees
        uint256 platformFeeAmount = msg.value * platformFeePercentage / BASIS_POINTS;
        uint256 creatorRoyaltyAmount = msg.value * creatorRoyaltyPercentage / BASIS_POINTS;
        uint256 netAmount = msg.value - platformFeeAmount - creatorRoyaltyAmount;

        uint256 ratePerSecond = netAmount / duration;
        require(ratePerSecond > 0, "Rate per second must be greater than 0");

        streamId = nextStreamId++;

        streams[streamId] = Stream({
            sender: msg.sender,
            recipient: recipient,
            deposit: netAmount,
            ratePerSecond: ratePerSecond,
            startTime: startTime,
            stopTime: stopTime,
            remainingBalance: netAmount,
            totalWithdrawn: 0,
            active: true,
            finalized: false,
            platformFeeAmount: platformFeeAmount,
            creatorRoyaltyAmount: creatorRoyaltyAmount,
            creatorAddress: collectionCreators[nftContract]
        });

        senderStreams[msg.sender].push(streamId);
        recipientStreams[recipient].push(streamId);

        emit StreamCreated(
            streamId,
            msg.sender,
            recipient,
            netAmount,
            ratePerSecond,
            startTime,
            stopTime,
            platformFeeAmount,
            creatorRoyaltyAmount
        );
    }

    /**
     * @dev Calculate the available balance for withdrawal
     * @param streamId The stream ID
     * @return The available balance
     */
    function balanceOf(uint256 streamId) external view returns (uint256) {
        Stream memory stream = streams[streamId];
        require(stream.sender != address(0), "Stream does not exist");

        if (block.timestamp <= stream.startTime) {
            return 0;
        }

        if (block.timestamp >= stream.stopTime) {
            return stream.remainingBalance;
        }

        uint256 elapsedTime = block.timestamp - stream.startTime;
        uint256 availableAmount = elapsedTime * stream.ratePerSecond;
        uint256 totalWithdrawn = stream.deposit - stream.remainingBalance;

        return availableAmount - totalWithdrawn;
    }

    /**
     * @dev Withdraw available funds from a stream with enhanced security
     * @param streamId The stream ID
     * @param amount Amount to withdraw (0 for all available)
     */
    function withdrawFromStream(uint256 streamId, uint256 amount) external nonReentrant whenNotPaused {
        Stream storage stream = streams[streamId];
        require(stream.recipient == msg.sender, "Not the recipient");
        require(stream.active && !stream.finalized, "Stream not active");

        uint256 availableBalance = this.balanceOf(streamId);
        require(availableBalance > 0, "No funds available");

        uint256 withdrawAmount = amount == 0 ? availableBalance : amount;
        require(withdrawAmount <= availableBalance, "Insufficient balance");
        require(withdrawAmount <= stream.remainingBalance, "Exceeds remaining balance");

        stream.remainingBalance = stream.remainingBalance - withdrawAmount;
        stream.totalWithdrawn = stream.totalWithdrawn + withdrawAmount;

        payable(msg.sender).transfer(withdrawAmount);

        emit StreamWithdrawn(streamId, msg.sender, withdrawAmount, stream.totalWithdrawn);
    }

    /**
     * @dev Release funds automatically (called by upkeeper bots)
     * @param streamId The stream ID
     */
    function releaseFunds(uint256 streamId) external nonReentrant {
        Stream storage stream = streams[streamId];
        require(stream.active && !stream.finalized, "Stream not active");
        require(block.timestamp >= stream.startTime, "Stream not started");

        uint256 availableBalance = this.balanceOf(streamId);
        if (availableBalance > 0) {
            stream.remainingBalance = stream.remainingBalance - availableBalance;
            stream.totalWithdrawn = stream.totalWithdrawn + availableBalance;

            payable(stream.recipient).transfer(availableBalance);

            emit StreamWithdrawn(streamId, stream.recipient, availableBalance, stream.totalWithdrawn);
        }
    }

    /**
     * @dev Finalize a stream and distribute remaining funds and fees
     * @param streamId The stream ID
     */
    function finalizeStream(uint256 streamId) external onlyAuthorized {
        Stream storage stream = streams[streamId];
        require(stream.active && !stream.finalized, "Stream not active");

        stream.active = false;
        stream.finalized = true;

        // Transfer any remaining balance to recipient
        if (stream.remainingBalance > 0) {
            payable(stream.recipient).transfer(stream.remainingBalance);
            stream.totalWithdrawn = stream.totalWithdrawn + stream.remainingBalance;
            stream.remainingBalance = 0;
        }

        // Distribute platform fee to treasury
        if (stream.platformFeeAmount > 0 && treasury != address(0)) {
            payable(treasury).transfer(stream.platformFeeAmount);
            emit PlatformFeeWithdrawn(treasury, stream.platformFeeAmount);
        }

        // Distribute creator royalty
        if (stream.creatorRoyaltyAmount > 0 && stream.creatorAddress != address(0)) {
            payable(stream.creatorAddress).transfer(stream.creatorRoyaltyAmount);
            emit CreatorRoyaltyPaid(stream.creatorAddress, stream.creatorRoyaltyAmount);
        }

        emit StreamFinalized(
            streamId,
            stream.totalWithdrawn,
            stream.platformFeeAmount,
            stream.creatorRoyaltyAmount
        );
    }


    /**
     * @dev Get stream details
     * @param streamId The stream ID
     * @return Stream struct
     */
    function getStream(uint256 streamId) external view returns (Stream memory) {
        return streams[streamId];
    }

    /**
     * @dev Get streams where user is sender
     * @param user User address
     * @return Array of stream IDs
     */
    function getSenderStreams(address user) external view returns (uint256[] memory) {
        return senderStreams[user];
    }

    /**
     * @dev Get streams where user is recipient
     * @param user User address
     * @return Array of stream IDs
     */
    function getRecipientStreams(address user) external view returns (uint256[] memory) {
        return recipientStreams[user];
    }

    /**
     * @dev Check if a stream is active and ongoing
     * @param streamId The stream ID
     * @return True if stream is active
     */
    function isStreamActive(uint256 streamId) external view returns (bool) {
        Stream memory stream = streams[streamId];
        return stream.active && 
               block.timestamp >= stream.startTime && 
               block.timestamp < stream.stopTime &&
               stream.remainingBalance > 0;
    }

    /**
     * @dev Get the current streaming rate for a stream
     * @param streamId The stream ID
     * @return Rate per second in wei
     */
    function getStreamRate(uint256 streamId) external view returns (uint256) {
        return streams[streamId].ratePerSecond;
    }

    /**
     * @dev Calculate total streamed amount so far
     * @param streamId The stream ID
     * @return Total amount streamed
     */
    function getTotalStreamed(uint256 streamId) external view returns (uint256) {
        Stream memory stream = streams[streamId];
        require(stream.sender != address(0), "Stream does not exist");

        if (block.timestamp <= stream.startTime) {
            return 0;
        }

        uint256 endTime = block.timestamp >= stream.stopTime ? stream.stopTime : block.timestamp;
        uint256 elapsedTime = endTime - stream.startTime;

        return elapsedTime * stream.ratePerSecond;
    }

    /**
     * @dev Cancel a stream and return remaining funds with pro-rata distribution
     * @param streamId The stream ID
     */
    function cancelStream(uint256 streamId) external nonReentrant {
        Stream storage stream = streams[streamId];
        require(
            stream.sender == msg.sender || 
            stream.recipient == msg.sender ||
            authorizedContracts[msg.sender],
            "Not authorized"
        );
        require(stream.active && !stream.finalized, "Stream not active");

        uint256 availableToRecipient = this.balanceOf(streamId);
        uint256 remainingToSender = stream.remainingBalance - availableToRecipient;

        stream.active = false;
        stream.finalized = true;
        stream.remainingBalance = 0;

        if (availableToRecipient > 0) {
            payable(stream.recipient).transfer(availableToRecipient);
        }

        if (remainingToSender > 0) {
            payable(stream.sender).transfer(remainingToSender);
        }

        emit StreamCancelled(
            streamId,
            stream.sender,
            stream.recipient,
            remainingToSender,
            availableToRecipient
        );
    }

    /**
     * @dev Set creator address for a collection
     * @param nftContract NFT contract address
     * @param creator Creator address
     */
    function setCollectionCreator(address nftContract, address creator) external onlyOwner {
        collectionCreators[nftContract] = creator;
    }

    /**
     * @dev Update platform fee percentage
     * @param newFeePercentage New fee percentage in basis points
     */
    function updatePlatformFee(uint256 newFeePercentage) external onlyOwner {
        require(newFeePercentage <= 1000, "Fee too high"); // Max 10%
        platformFeePercentage = newFeePercentage;
    }

    /**
     * @dev Update creator royalty percentage
     * @param newRoyaltyPercentage New royalty percentage in basis points
     */
    function updateCreatorRoyalty(uint256 newRoyaltyPercentage) external onlyOwner {
        require(newRoyaltyPercentage <= 500, "Royalty too high"); // Max 5%
        creatorRoyaltyPercentage = newRoyaltyPercentage;
    }

    /**
     * @dev Update treasury address
     * @param newTreasury New treasury address
     */
    function updateTreasury(address newTreasury) external onlyOwner {
        require(newTreasury != address(0), "Invalid treasury address");
        treasury = newTreasury;
    }

    /**
     * @dev Add authorized contract
     * @param contractAddr Contract address to authorize
     */
    function addAuthorizedContract(address contractAddr) external onlyOwner {
        authorizedContracts[contractAddr] = true;
    }

    /**
     * @dev Remove authorized contract
     * @param contractAddr Contract address to remove
     */
    function removeAuthorizedContract(address contractAddr) external onlyOwner {
        authorizedContracts[contractAddr] = false;
    }

    /**
     * @dev Update maximum stream duration
     * @param newMaxDuration New maximum duration in seconds
     */
    function updateMaxStreamDuration(uint256 newMaxDuration) external onlyOwner {
        require(newMaxDuration >= MINIMUM_STREAM_DURATION, "Duration too short");
        maxStreamDuration = newMaxDuration;
    }

    /**
     * @dev Emergency pause function
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @dev Unpause function
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    /**
     * @dev Emergency function to recover stuck funds (only owner)
     * @param streamId The stream ID
     */
    function emergencyWithdraw(uint256 streamId) external onlyOwner {
        Stream storage stream = streams[streamId];
        require(stream.remainingBalance > 0, "No balance to withdraw");

        uint256 amount = stream.remainingBalance;
        stream.remainingBalance = 0;
        stream.active = false;
        stream.finalized = true;

        payable(owner()).transfer(amount);
    }

    /**
     * @dev Get comprehensive stream information
     * @param streamId The stream ID
     * @return Stream struct with all details
     */
    function getStreamDetails(uint256 streamId) external view returns (Stream memory) {
        return streams[streamId];
    }

    /**
     * @dev Get total platform fees collected
     * @return Total platform fees in contract
     */
    function getTotalPlatformFees() external view returns (uint256) {
        uint256 totalFees = 0;
        for (uint256 i = 0; i < nextStreamId; i++) {
            if (streams[i].finalized) {
                totalFees += streams[i].platformFeeAmount;
            }
        }
        return totalFees;
    }

    /**
     * @dev Get total creator royalties collected
     * @return Total creator royalties in contract
     */
    function getTotalCreatorRoyalties() external view returns (uint256) {
        uint256 totalRoyalties = 0;
        for (uint256 i = 0; i < nextStreamId; i++) {
            if (streams[i].finalized) {
                totalRoyalties += streams[i].creatorRoyaltyAmount;
            }
        }
        return totalRoyalties;
    }

    /**
     * @dev Withdraw accumulated platform fees
     */
    function withdrawPlatformFees() external onlyOwner {
        require(treasury != address(0), "Treasury not set");
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");

        payable(treasury).transfer(balance);
        emit PlatformFeeWithdrawn(treasury, balance);
    }

    /**
     * @dev Receive function to accept ETH
     */
    receive() external payable {}
}

